                            Body = "Bonjour,\nJe pense à acheter la KIA SELTOS.\nÀ votre avis, vaut-il vraiment le coup de dépenser 19 milles dinars de plus et opter pour la Ateca Xperience ?\nJ'apprécierais beaucoup votre aide, je suis très hésitant.\nQu'en pensez-vous ?\nMerci d'avance.",
